### Model Building

# This has to stay the same because that is how are our images are sized
img_shape = (299,299,3)
# Define the base model using ResNet50 architecture, pre-trained on ImageNet
# include_top=False removes the original classification layers
# pooling='max' adds a global max pooling layer to flatten the output
# * You can change ResNet50 to another model like Xception, EfficientNet, etc. later**
base_model = tf.keras.applications.ResNet50(
    include_top=False, # no classification layer
    weights="imagenet",
    input_shape=img_shape,  # (299, 299, 3)  must match our image size
    pooling='max'           # * You can try 'avg' instead of 'max'
)

# Build a sequential model by stacking layers
model = Sequential([
    base_model,             # Pre-trained feature extractor (frozen or trainable)

    Flatten(),              # Converts the 2D output of base_model to 1D

    Dropout(rate=0.5),      # * Randomly drops 30% of neurons to prevent overfitting
                            # * You can try values like 0.2, 0.4, etc.

    Dense(256, activation='relu'),  # * Fully connected layer with 128 neurons
                                    # * You can change 128 to 64, 256, 66, etc.

    Dropout(rate=0.5),     # * Another dropout layer (25% dropout)
                            # * You can adjust this too

    Dense(4, activation='softmax')  # Final output layer for 4-class classification

])

# Compile the model with optimizer, loss function, and metrics
model.compile(
    Adamax(learning_rate=0.001),    # * Optimizer with learning rate
                                    # * Try 0.0005 or 0.0001 for slower, more stable learning

    loss='categorical_crossentropy',  # For multi-class classification with one-hot labels

    metrics=[
        'accuracy',                 # * Accuracy: (TP+TN) / (TP + FP + TN + FN) - how many the model got correct in total
        Precision(),                # * Precision: TP / (TP + FP)
        Recall()                    # * Recall: TP / (TP + FN)
    ]
)

# Print a summary of the model architecture
model.summary()

"""# Model Training"""

